import logo from './logo.svg';
import './App.css';
import Banner from './components/Banner';

function App() {
  return (
    <div>
        <Header />
        <Router>
          <div className='body-wrapper'>
            <Navbar />
            <div className='main-wrapper'>
              <div className='loader'>
                <Routes>
                  <Route path='/' element={<Banner />}/>
                </Routes>
              </div>
            </div>
          </div>
          <Footer />
        </Router>
    </div>
  );
}

export default App;
